import React,{useState,useEffect} from 'react'
import {useSelector,useDispatch} from 'react-redux'
import {MdModeEdit} from "react-icons/md"

import './index.scss'
import Metatable from './metatable'
import Fieldstable from './fieldstable'
import Stacked from './dataCompletnessChart'
import Modal from './modal'
import InfoPage from './infoPage'
import BarChart from './barChart'
import {getUpdateActiveTab} from './../../../actions/dataActions'

export default function RightSection() {

    const [isModalOpen,setModalOpen]=useState(false)
    const [whichModalOpen,setWhichModalOpen]=useState(null)

    const selectedEvent=useSelector((state) => state.dataReducer.selectedEvent)
    const authenticationData=useSelector((state) => state.dataReducer.authenticationData)
    const fields=useSelector((state) => state.dataReducer.selectedFields)
    const processedRecordsCount=useSelector((state) => state.dataReducer.processedRecordsCount)
    const sqoopCount=useSelector((state) => state.dataReducer.sqoopCount)
    const maxwellCount=useSelector((state) => state.dataReducer.maxwellCount)
    const events=useSelector((state) => state.dataReducer.selectedEventMeta[0])
    const mongoCount=useSelector((state) => state.dataReducer.mongoCount)
    const activeTab=useSelector((state) => state.dataReducer.activeTab)
    // console.log(activeTab,'activeTab ,,,,,,');
    const dispatch=useDispatch()

    const closeModal=() => {setModalOpen(false)}

    const handleEditClick=(e) => {
        setWhichModalOpen(e)
        setModalOpen(true)
    }
    useEffect(() => {

        if((sqoopCount.length===0&&maxwellCount.length===0)||maxwellCount.length===0||events.type!=="TRANSACTIONAL") {
            // setActiveTab(1)
            //   dispatch(getUpdateActiveTab(tab))

        }

    },[sqoopCount,maxwellCount,events])
    const handleActiveTab=(tab) => {
        // console.log('handle');
        dispatch(getUpdateActiveTab(tab))

    }
    useEffect(() => {
    },[])

    return (
        <div className='right-section'>
            {
                (selectedEvent!==""&&fields!==JSON.stringify({}))&&fields[0]?
                    <>
                        <div className='tabs-sec'>
                            <div className={activeTab===1? 'active':'inactive'} onClick={() => handleActiveTab(1)}>Meta Data</div>

                            <div className={activeTab===2? 'active':'inactive'} onClick={() => handleActiveTab(2)}>Data Quality</div>
                            {events.type==="TRANSACTIONAL"&&(sqoopCount.length>0&&events['ingestionStrategy']?.toLowerCase()==='sqoop')&&
                                <div className={activeTab===3? 'active':'inactive'} onClick={() => handleActiveTab(3)}>Data Completeness trend</div>
                            }
                            {events.type==="TRANSACTIONAL"&&(maxwellCount.length>0&&events['ingestionStrategy']?.toLowerCase()==='maxwell')&&
                                <div className={activeTab===3? 'active':'inactive'} onClick={() => handleActiveTab(3)}>Data Completeness trend</div>
                            }
                            {events.type==="TRANSACTIONAL"&&(mongoCount.length>0&&events['sourceType']?.toLowerCase()==='mongo')&&
                                <div className={activeTab===3? 'active':'inactive'} onClick={() => handleActiveTab(3)}>Data Completeness trend</div>
                            }
                            {/* {events.type === "TRANSACTIONAL" && (sqoopCount.length > 0 && events['ingestionStrategy']?.toLowerCase() === 'sqoop') || (maxwellCount.length > 0 && events['ingestionStrategy']?.toLowerCase() === 'maxwell') &&
                                <div className={activeTab === 3 ? 'active' : 'inactive'} onClick={() => handleActiveTab(3)}>Data Completeness trend</div>
                            } */}

                        </div>
                        {
                            activeTab===1?
                                <>
                                    <div className="top-row">
                                        <p>Event Meta</p>
                                        {
                                            authenticationData.userType==="ADMIN"&&<MdModeEdit onClick={() => handleEditClick(1)} />
                                        }
                                    </div>
                                    <Metatable />
                                    <div className="top-row">
                                        <p>Fields Meta</p>
                                        {
                                            authenticationData.userType==="ADMIN"&&<MdModeEdit onClick={() => handleEditClick(2)} />
                                        }
                                    </div>
                                    <Fieldstable />

                                </>:activeTab===2?
                                    <>
                                        {
                                            processedRecordsCount.length>0&&
                                            <div className='bar-chart'>
                                                <BarChart activeTab={activeTab} />
                                            </div>
                                        }
                                    </>:<div className="top-row">
                                        {activeTab===3&&events.type==="TRANSACTIONAL"&&
                                            <Stacked />

                                        }
                                    </div>
                        }
                    </>:
                    <InfoPage />
            }
            {
                isModalOpen&&<Modal closeModal={closeModal} whichModalOpen={whichModalOpen} />
            }
        </div>
    )
}
